import React from 'react';
import styled from 'styled-components';
import Animal from './Animal.json';
import AnimalControl from './AnimalControl';



function Animals() {
  return (
    <div>
      {
        Animal.map(item => {
          return <AnimalControl key={item.id} item={item}/>
        })
      }
    </div>
  )
}

export default Animals
